import React, { Component, Fragment } from 'react';
import {Paper, Card, CardActionArea} from '@material-ui/core';


import './Parking.scss';

 class Parking extends Component {


    render(props) {

        //console.log(this.props.params.id);



        return (
            <Fragment>
                <Card>
                    <CardActionArea>
                    <div className="parking" onClick={this.props.clicked}>
                        <div className="parking__wrapper">
                            <Paper>
                                <div className="parking__wrapper_card">
                                    {/* <Link to={'/parking-details/' +this.props.id} style={{ textDecoration: 'none' }}> */}
                                    <p className="parking__wrapper_card_heading">Parking Space  <b>{this.props.title}</b> </p>
                                    <p className="parking__wrapper_card_address">Type   <b>{this.props.address}</b> </p>
                                    <p className="parking__wrapper_card_created">Tarrif   <b>{this.props.created}</b> </p>
                                    <p className="parking__wrapper_card_update">Address   <b>{this.props.verified}</b> </p>

                                </div>
                            </Paper>

                        </div>
                    </div>
                    </CardActionArea>
                </Card>

            </Fragment>

        )
    }
}
export default Parking;
